import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <h1 style={{margin:0}}>Castaway</h1>
        </div>
        <nav>
          <a href="#">Home</a>
          <a href="#">Episodes</a>
          <a href="#">About</a>
          <a href="#">Contact</a>
        </nav>
      </header>
      <section></section>
    </div>
  );
}

export default App;
